import React, { Component } from 'react';
import logo from './logo.svg';
import $ from 'jquery';
import './App.css';
import NavBar from "./components/NavBar";
import Banner from "./components/Banner";

class App extends Component {
  render() {
    return <div>
      <NavBar />
      <Banner />
    </div>
  }
};

export default App;
